import data from "./data";

function App() {
  return (
    <div >
      <header>
        <a href="/">Smilz</a>
      </header>
      <main>
       <h1><b>TREATMENT</b></h1> 
       {
        data.products.map(product => (<div>
          <img src={product.image} alt={product.name} />
          <p>{product.name}</p>
          <p>{product.price}</p>
        </div>))
       }
      </main>
    </div>
  );
}

export default App;
